import React from "react";
import "./Header.css";

const Header = () => {
  return (
    <header>
      <h1>Adam's DnD Hosting</h1>
      <nav>
        <a href="#">Home</a>
        <a href="#features">Features</a>
        <a href="#login">Login</a>
      </nav>
    </header>
  );
};

export default Header;
